import React from 'react';
import { Card, Typography, Button, IconButton, Container, makeStyles } from '@material-ui/core';
import Accordion from '../components/Accordion';
import { Helmet } from 'react-helmet';
import LivePerson from '../media/LivePersonLogo.png';
import CFC from '../media/center-for-cybersecurity.png';



const useStyles = makeStyles((theme) => ({
  button: {
    marginLeft: 5,
    marginRight: 5,
    '&:hover': {
        backgroundColor: 'none',
    },
    border: '1px solid black',
    backgroundColor: theme.palette.primary.main,
    textTransform: 'none',
  },
  root: {
    flexGrow: 1,
  },
  menuButton: {
    fontSize: 16,
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
  menuItem: {
    float: 'right',
    display: 'block',
  },
  link: {
    fontSize: 16,
    '&:hover': {
        backgroundColor: theme.palette.primary.main,
    },
  },
}));

function Experience(){

  const classes = useStyles();


  let livePersonDesc = "I currently am employed at LivePerson \
  as a Conversational AI Engineer on the Expert Engineering Team.\
  I work with natural language processing, natural language understanding,\
  front-end development in React.js, and a bit of data analytics."

  let researchDesc = "I was employed as a Research Assistant for the \
  Rochester Institute of Technology at the Center for Cybersecurity. \
  I worked on a digital fingerprinting project alongside the \
  Tor team to develop a packet obfuscation program to prevent \
  Tor ";

  return(
    <Container maxWidth="lg" style={{marginTop: 150, marginBottom: 300}}>
      <Helmet>
        <body style="
        background-image: url('../pbackground.png');
        background-repeat: no-repeat;
        background-size: cover;"
        />
      </Helmet>

      <Accordion
      description={livePersonDesc}
      title={"Conversational AI Engineer"}
      setting={"LivePerson"}
      date={"June 2020 - present"}
      image={LivePerson}
      imageMargin={110}>
        <Button className={classes.button}>React</Button>
        <Button className={classes.button}>JavaScript</Button>
        <Button className={classes.button}>Figma</Button>
        <Button className={classes.button}>Python</Button>
        <Button className={classes.button}>NLU & NLP</Button>
      </Accordion>



      <div style={{marginTop: 75}}>
      <Accordion
        description={researchDesc}
        title={"Research Assistant"}
        setting={"Rochester Institute of Technology"}
        date={"September 2020 - June 2020"}
        image={CFC}
        imageMargin={0}>
        <Button className={classes.button}>TensorFlow</Button>
        <Button className={classes.button}>C</Button>
        <Button className={classes.button}>Figma</Button>
        <Button className={classes.button}>NLU & NLP</Button>      
        <Button className={classes.button}>Python</Button>

      </Accordion>
      </div>
    </Container>

  )
}

export default Experience;
